import React, { Component } from 'react';


class StockData extends Component {
    state = {
        info: {}
    }
    componentDidMount() {
        fetch('http://localhost:4000/stockdata')
        .then(res => res.json())
        .then((data) => {
            this.setState({ info: data})
            console.log(this.state.info)
        })
        .catch(console.log)
    }

    render() {
        return (
            <div>
                <h1>It Worked!</h1>
            </div>
        )
    }
}

export default StockData;
